document.addEventListener("mousemove", (e) => {
  mouseX = e.clientX;
  mouseY = e.clientY;

  if (mouseX>=1640 && mouseX<=1845 && mouseY>=80 && mouseY<=875) {
    if (document.querySelector('.sidebar').classList.contains("hidden")){
      sidebarVisibility();
    }
  }
  else {
    if (document.querySelector('.sidebar').classList.contains("hidden")===false){
      sidebarVisibility();
    }
  }
})

function zoomIn() {
  nowfontsize ++;
  if (document.getElementById("feature1")!==null) {
    feature1();
  }
  else if (document.getElementById("feature2")!==null) {
    feature2();
  }
  else if (document.getElementById("feature3")!==null) {
    feature3();
  }
  else if (document.getElementById("target")!==null) {
    targetgene();
  }
}

function zoomOut() {
  nowfontsize --;
  if (document.getElementById("feature1")!==null) {
    feature1();
  }
  else if (document.getElementById("feature2")!==null) {
    feature2();
  }
  else if (document.getElementById("feature3")!==null) {
    feature3();
  }
  else if (document.getElementById("target")!==null) {
    targetgene();
  }
}


/* target gene 일단 출력 */
function targetgene() {
  document.getElementById("app").innerHTML = `
    <h1 id="target" style="font-size: ${nowfontsize}px">${targetseq}</h1>
  `
  targetHTML = document.getElementById("app").innerHTML;
  nowstart=0;
  nowend=document.getElementById("app").innerText.toString().length;
}


/* 형광 표시 없애기 */
function nowgene() {

  html = ``
  
  document.getElementById("app").innerHTML = targetHTML;
  nowseq = document.getElementById("app").innerText.toString();

  document.getElementById("app").innerHTML = `
    <h1 id="target" style="font-size: ${nowfontsize}px">${nowseq}</h1>
  `
  
  targetHTML = document.getElementById("app").innerHTML;

}


/*intron-exon*/
function feature1() {

  html = ``
  
  document.getElementById("app").innerHTML = targetHTML;
  nowseq = document.getElementById("app").innerText.toString();

  x=0;
  for (i=nowstart; i<nowend+1; i++) {
    if (i===exonLoc[x][1] && x<exonLoc.length-1) x += 1;
    if (i >= exonLoc[x][0]-1 && i<exonLoc[x][1]) {
      
      if (nowstart>exonLoc[x][0] && x===0) {
        html += `<h1 id="feature1" style="font-size: ${nowfontsize}px"><span title="[exon]${nowstart}-${exonLoc[x][1]}bp : ${exonName[x]}">${targetseq.slice(nowstart, exonLoc[x][1])}</span></h1>`
        i = exonLoc[x][1]-1;
        }
      else if (nowend<exonLoc[x][1] && x===exonLoc.length-1) {
        html += `<h1 id="feature1" style="font-size: ${nowfontsize}px"><span title="[exon] ${exonLoc[x][0]}-${nowend+1}bp : ${exonName[x]}">${targetseq.slice(exonLoc[x][0]-1, nowend+1)}</span></h1>`
        i = nowend;
      }
      else{
        html += `<h1 id="feature1" style="font-size: ${nowfontsize}px"><span title="[exon] ${exonLoc[x][0]}-${exonLoc[x][1]}bp : ${exonName[x]}">${targetseq.slice(exonLoc[x][0]-1, exonLoc[x][1])}</span></h1>`
        i = exonLoc[x][1]-1;
      }
    }

    else {
      html += `<h1 id="target" style="font-size: ${nowfontsize}px"><span title="[intron]">${targetseq[i]}</span></h1>`;
    }
  }

  document.getElementById("app").innerHTML = html;
  
  targetHTML = document.getElementById("app").innerHTML;

  /*
  document.getElementById("app").innerHTML = `
    <h1 id="feature1" style="font-size: ${nowfontsize}px">${targetseq}</h1>
  `*/
}

/*coordinate?*/
function feature2() {
  html = ``

  document.getElementById("app").innerHTML = targetHTML;
  nowseq = document.getElementById("app").innerText.toString();
  
  x=0;
  for (i=nowstart; i<nowend+1; i++) {
    if (i===cpgLoc[x][1] && x<cpgLoc.length-1) x += 1;
    if (i >= cpgLoc[x][0]-1 && i<cpgLoc[x][1]) {
      if (nowstart>cpgLoc[x][0] && x===0) {
        html += `<h1 id="feature2" style="font-size: ${nowfontsize}px"><span title="[CpG] ${nowstart+1}-${cpgLoc[x][1]}bp : ${perCpg[x]}">${targetseq.slice(nowstart, cpgLoc[x][1])}</span></h1>`
        i = cpgLoc[x][1]-1;
        }
      else if (nowend<cpgLoc[x][1] && x===cpgLoc.length-1) {
        html += `<h1 id="feature2" style="font-size: ${nowfontsize}px"><span title="[CpG] ${cpgLoc[x][0]}-${nowend+1}bp : ${perCpg[x]}">${targetseq.slice(cpgLoc[x][0]-1, nowend+1)}</span></h1>`
        i = nowend;
      }
      else{
        html += `<h1 id="feature2" style="font-size: ${nowfontsize}px"><span title="[CpG] ${cpgLoc[x][0]}-${cpgLoc[x][1]}bp : ${perCpg[x]}">${targetseq.slice(cpgLoc[x][0]-1, cpgLoc[x][1])}</span></h1>`
        i = cpgLoc[x][1]-1;
      }
    }
    else {
      html += `<h1 id="target" style="font-size: ${nowfontsize}px"><span title="[other part]">${targetseq[i]}</span></h1>`;
    }
  }

  document.getElementById("app").innerHTML = html;

  targetHTML = document.getElementById("app").innerHTML;

  /*
  document.getElementById("app").innerHTML = `
    <h1 id="feature2" style="font-size: ${nowfontsize}px">${targetseq}</h1>
  `*/
}

